import React from 'react'
import { Container, Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap'
import './Navibar.css'
import { useNavigate } from 'react-router'
import { useState } from 'react'
import { toast } from 'react-toastify'

const AdminNav = () => {


  const navigate = useNavigate()
  const [show, setShow]= useState(true)

  let loginRegister

  const { firstName, loginStatus } = sessionStorage

  if (firstName != undefined) {
    loginRegister = `Hello, ${firstName}`
  } else {
    loginRegister = "Login"
  }

  const logoutUser = () => {
    // remove the logged users details from session storage

    if (firstName == undefined) {
      toast.warning("please login first")
    }

    sessionStorage.removeItem("id")
    sessionStorage.removeItem("firstName")
    sessionStorage.removeItem("lastName")
    sessionStorage.removeItem("loginStatus")

    // navigate to sign in component
    navigate("/")
  }




  return (
<div >
<Navbar className='Main-Nav'>
  <Container fluid>
    <Navbar.Brand className='Brand' style={{color:"black"}} href="/admin">E-LEARNING</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbarScroll" />
    <Navbar.Collapse id="navbarScroll">
        <br/>
        <Navbar.Brand className='Brand' style={{color:"black"}} href="/admin">Admin Panal</Navbar.Brand>
      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}
        navbarScroll
      >
       <Nav.Link href="/admin">Courses</Nav.Link>
        <Nav.Link href="/courseChapter">Chapters</Nav.Link>
        <Nav.Link href="/coursechaptercontent">Chapter_Content</Nav.Link>
        {/* <Nav.Link href="/Enrollment">enrollment</Nav.Link> */}
        <Nav.Link href="/user">User</Nav.Link>
       
      </Nav>

      <Button className='btn btn-info' ><Nav.Link to="/Profile">Profile</Nav.Link></Button>       
      <button className='btn btn-danger' onClick={logoutUser}>Logout</button>
    
    </Navbar.Collapse>
  </Container>
</Navbar>
</div>
  )
}

export default AdminNav
